class Point:    def __init__(self, x, y):        self.x = x        self.y = y    def move(self, x, y):        self.x += x        self.y += y    def compute_distance(self, point2):        print((((self.x - point2.x)**2) + ((self.y -point2.y)**2)) ** 0.5)    def show(self):        print(self.x, self.y)point1 = Point(1, 0)point1.move(2, 4)point1.show()point2 = Point(4, 4)point1.compute_distance(point2)